description:
Shifty, a young crack cocaine dealer in London, sees his life quickly spiral out of control when his best friend returns home.

Stalked by a customer desperate to score at all costs, and with his family about to turn their back on him for good, Shifty must out-run and out-smart a rival drug dealer, intent on setting him up for a big fall. As his long time friend Chris, confronts the dark past he left behind him, Shifty is forced to face up to the violent future he's hurtling towards....

